function showSearchProfiles(profiles) {
  let container = document.createElement("div");
  let inptComponent = document.querySelector("#search-input");
  let containerProfile;
  let profile;
  let picture;
  profiles.map((values) => {
    containerProfile = document.createElement("div");
    profile = document.createElement("span");
    picture = document.createElement("img");

    profile.innerHTML = `${values?.user?.username}`;
    picture.src = `${values?.picture}`;

    profile.classList = "h5 go-to-profile";
    picture.classList = "profile-img-comment rounded-circle go-to-profile";
    containerProfile.append(picture, profile);
  });
  container.append(containerProfile);
  return(
    <div>
      <div>
      <span className="h5 go-to-profile">

      </span>

      <img  src={values.picture} alt="s" className="profile-img-comment rounded-circle go-to-profile"/>
      </div>
    </div>
  )
}

export { showSearchProfiles };
